Bạn có muốn thay đổi tài khoản của dữ liệu cũng như nguồn dữ liệu cho '{0}'?

Cũ thành viên dữ liệu cũng như nguồn dữ liệu: {1}
	Dữ liệu nguồn/dữ liệu thành viên mới: {2}

Không thể tải bảng bởi vì các tập tin không thể được tìm thấy hoặc nó không phải là một tập tin bảng điều khiển hợp lệ.
{0}
Xin vui lòng đảm bảo rằng các ứng dụng có thể truy cập vào tập tin này và rằng nó là hợp lệ, hoặc chỉ định một tập tin khác nhau.

Không thể nạp dữ liệu từ nguồn dữ liệu đối tượng.
{0}
Nhấp vào ' có ' để tải dữ liệu như là. Nếu bạn lưu bảng điều khiển hiện tại, bạn có thể mất thông tin về nguồn dữ liệu đối tượng. Nhấp vào ' không ' để hủy tải bảng thông tin.
